import styles from "../assets/Styles/Header.module.scss";
import profilePhoto from "../assets/Images/profile-photo-1.jpg";

export default function Header() {
  const user = {
    name: "Amy",
    img: profilePhoto,
  };

  return (
    <div className={styles.headerDiv}>
      <div>
        <img src={user.img} className={styles.userImg} />
      </div>
      <div className={styles.userNameDiv}>
        <h2>{user.name}</h2>
      </div>
    </div>
  );
}
